import Head from 'next/head'
import NavBar from './NavBar'

const Layout = (props) => {
    return (
        <div>
            <Head>
                <title>
                    BitsPrice
                </title>
            </Head>
            <NavBar/>
            {props.children}
        </div>
    )
}

export default Layout
